import React from 'react'
import { Card } from 'react-bootstrap'

const Products = ({product}) => {
  return (
    <Card>
      <a href={`/p`}>
        <Card.Img variant="top" src={product.image} />
      </a>
    </Card>
  )
}

export default Products
